import React from 'react'
import Navbar from './NavBar'
import './Table.css'

const UserProfile = ()=>{
    const renderHeader = () => {
        let headerElement = ['Name', 'Email', 'Address', 'City', 'Province', 'ZIP']

        return headerElement.map((key, index) => {
            return <th key={index}>{key.toUpperCase()}</th>
        })
    }

    var name,email,address,city,province,zip;

    React.useEffect(()=>{
        //api call
        name = 'chandru';
        email = 'test@gmail.com';
        address = 'aadd';
        province = 'canada';
        zip = '111';
        city = 'temp'
    },[])

    const renderBody = () => {
                <tr>
                    <td>{name}</td>
                    <td>{email}</td>
                    <td>{address}</td>
                    <td>{city}</td>
                    <td>{province}</td>
                    <td>{zip}</td>
                </tr>
    }

    return(
        <div>
           <Navbar /> 
           <br/><br/>
           <div className="mytable"> 
           <table id="book">
                <thead>
                    <tr>{renderHeader()}</tr>
                </thead>
                {/* <tbody>
                    {renderBody()}
                </tbody> */}
            </table>
            </div>
        </div>
    )
}

export default UserProfile;
